webpackJsonp([79329639350609],{2453:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Among my existing works, it is the oldest 3DCG. It is also the oldest CG work created using a PC. There are memories that I made some even before, but it has disappeared completely.</p>\n<p>A 3D picture made as an illustration of the original comic " <a href="/cats_story">CATS STORY</a> " that was being made at the time. A serious story using the world view of the original comic "Aruko cats knockout" which was drawn around the age of 11. It was probably the first time that I made a serious story. Well, it\'s pretty childish story so even when the public is on the look out.</p>\n<p>Speaking of which, I remember when I entered the university that I tried to make this story RPG once again.</p>\n<p>The model uses DOGA - L2, the effects and characters use HyperPaint.</p>',frontmatter:{cover:null,date:"1997-12-01T00:00:00+09:00",strDate:"1997/11/30",title:"[3D] Earth"}}},pathContext:{path:"/en/blog/1997/12/01-3d-earth/",langKey:"en"}}}});
